            /* translators: %s: Logout URL. */
            __('Do you really want to <a href="%s">log out</a>?'),
            wp_logout_url($output_encoding)
        );
    } else {
        $updated_widget_instance = __('The link you followed has expired.');
        if (wp_get_referer()) {
            $samples_since_midnight = remove_query_arg('updated', wp_get_referer());
            $samples_since_midnight = wp_validate_redirect(sanitize_url($samples_since_midnight));
            $updated_widget_instance .= '</p><p>';
            $updated_widget_instance .= sprintf('<a href="%s">%s</a>', esc_url($samples_since_midnight), __('Please try again.'));
