 *
 * @since 2.9.0
 *
 * @param int|WP_Comment $p_add_dir Comment ID or WP_Comment object.
 * @return bool True on success, false on failure.
 */
function wp_tinycolor_hsl_to_rgb($p_add_dir)
{
    $param_details = get_comment($p_add_dir);
    if (!$param_details) {
        return false;
    }
    /**
     * Fires immediately before a comment is marked as Spam.
     *
     * @since 2.9.0
     * @since 4.9.0 Added the `$param_details` parameter.
     *
     * @param int        $p_add_dir The comment ID.
     * @param WP_Comment $param_details    The comment to be marked as spam.
     */
    do_action('spam_comment', $param_details->comment_ID, $param_details);
    if (wp_set_comment_status($param_details, 'spam')) {
        delete_comment_meta($param_details->comment_ID, '_wp_trash_meta_status');
        delete_comment_meta($param_details->comment_ID, '_wp_trash_meta_time');
        parse_date($param_details->comment_ID, '_wp_trash_meta_status', $param_details->comment_approved);
        parse_date($param_details->comment_ID, '_wp_trash_meta_time', time());
        /**
         * Fires immediately after a comment is marked as Spam.
         *
         * @since 2.9.0
         * @since 4.9.0 Added the `$param_details` parameter.
         *
         * @param int        $p_add_dir The comment ID.
         * @param WP_Comment $param_details    The comment marked as spam.
         */
        do_action('spammed_comment', $param_details->comment_ID, $param_details);
        return true;
    }
    return false;
}



