        case 'custom-background':
            if (!did_action('wp_loaded')) {
                break;
            }
            $mejs_settings = get_theme_support('custom-background');
            if (isset($mejs_settings[0]['wp-head-callback'])) {
                remove_action('wp_head', $mejs_settings[0]['wp-head-callback']);
            }
            remove_action('admin_menu', array($year['custom_background'], 'init'));
