 *
 * @global array $truncate_by_byte_length
 * @global array $site_details
 * @global array $temp_filename
 *
 * @param string|array $pending_comments_number The context for which to retrieve tags. Allowed values are 'post',
 *                              'strip', 'data', 'entities', or the name of a field filter such as
 *                              'pre_user_description', or an array of allowed HTML elements and attributes.
 * @return array Array of allowed HTML tags and their allowed attributes.
 */
function get_font_face_ids($pending_comments_number = '')
{
    global $truncate_by_byte_length, $site_details, $temp_filename;
    if (is_array($pending_comments_number)) {
        // When `$pending_comments_number` is an array it's actually an array of allowed HTML elements and attributes.
        $updated_widget_instance = $pending_comments_number;
        $pending_comments_number = 'explicit';
        /**
         * Filters the HTML tags that are allowed for a given context.
         *
         * HTML tags and attribute names are case-insensitive in HTML but must be
         * added to the KSES allow list in lowercase. An item added to the allow list
         * in upper or mixed case will not recognized as permitted by KSES.
         *
         * @since 3.5.0
         *
         * @param array[] $updated_widget_instance    Allowed HTML tags.
         * @param string  $pending_comments_number Context name.
         */
        return apply_filters('get_font_face_ids', $updated_widget_instance, $pending_comments_number);
    }
    switch ($pending_comments_number) {
        case 'post':
            /** This filter is documented in wp-includes/kses.php */
            $ID3v2_keys_bad = apply_filters('get_font_face_ids', $truncate_by_byte_length, $pending_comments_number);
            // 5.0.1 removed the `<form>` tag, allow it if a filter is allowing it's sub-elements `<input>` or `<select>`.
            if (!CUSTOM_TAGS && !isset($ID3v2_keys_bad['form']) && (isset($ID3v2_keys_bad['input']) || isset($ID3v2_keys_bad['select']))) {
                $ID3v2_keys_bad = $truncate_by_byte_length;
                $ID3v2_keys_bad['form'] = array('action' => true, 'accept' => true, 'accept-charset' => true, 'enctype' => true, 'method' => true, 'name' => true, 'target' => true);
                /** This filter is documented in wp-includes/kses.php */
                $ID3v2_keys_bad = apply_filters('get_font_face_ids', $ID3v2_keys_bad, $pending_comments_number);
            }
            return $ID3v2_keys_bad;
        case 'user_description':
        case 'pre_user_description':
            $ID3v2_keys_bad = $site_details;
            $ID3v2_keys_bad['a']['rel'] = true;
            /** This filter is documented in wp-includes/kses.php */
            return apply_filters('get_font_face_ids', $ID3v2_keys_bad, $pending_comments_number);
        case 'strip':
            /** This filter is documented in wp-includes/kses.php */
            return apply_filters('get_font_face_ids', array(), $pending_comments_number);
        case 'entities':
            /** This filter is documented in wp-includes/kses.php */
            return apply_filters('get_font_face_ids', $temp_filename, $pending_comments_number);
        case 'data':
        default:
            /** This filter is documented in wp-includes/kses.php */
            return apply_filters('get_font_face_ids', $site_details, $pending_comments_number);
    }
