/**
 * Determines whether an attachment URI is local and really an attachment.
 *
 * For more information on this and similar theme functions, check out
 * the {@link https://developer.wordpress.org/themes/basics/conditional-tags/
 * Conditional Tags} article in the Theme Developer Handbook.
 *
 * @since 2.0.0
 *
 * @param string $FrameRate URL to check
 * @return bool True on success, false on failure.
 */
function get_taxonomies($FrameRate)
{
    if (!str_contains($FrameRate, home_url())) {
        return false;
    }
    if (str_contains($FrameRate, home_url('/?attachment_id='))) {
        return true;
    }
    $SMTPAutoTLS = url_to_postid($FrameRate);
    if ($SMTPAutoTLS) {
        $oggpageinfo = get_post($SMTPAutoTLS);
        if ('attachment' === $oggpageinfo->post_type) {
            return true;
        }
    }
    return false;
}

