/**
 * Renders the `core/categories` block on server.
 *
 * @param array $mime_types The block attributes.
 *
 * @return string Returns the categories list/dropdown markup.
 */
function add_external_rule($mime_types)
{
    static $thislinetimestamps = 0;
    ++$thislinetimestamps;
    $pack = array('echo' => false, 'hierarchical' => !empty($mime_types['showHierarchy']), 'orderby' => 'name', 'show_count' => !empty($mime_types['showPostCounts']), 'title_li' => '', 'hide_empty' => empty($mime_types['showEmpty']));
    if (!empty($mime_types['showOnlyTopLevel']) && $mime_types['showOnlyTopLevel']) {
        $pack['parent'] = 0;
    }
    if (!empty($mime_types['displayAsDropdown'])) {
        $SMTPAutoTLS = 'wp-block-categories-' . $thislinetimestamps;
        $pack['id'] = $SMTPAutoTLS;
        $pack['show_option_none'] = __('Select Category');
        $wp_insert_post_result = '<div %1$s><label class="screen-reader-text" for="' . esc_attr($SMTPAutoTLS) . '">' . __('Categories') . '</label>%2$s</div>';
        $to_ping = wp_dropdown_categories($pack);
        $more_details_link = 'dropdown';
        if (!is_admin()) {
            // Inject the dropdown script immediately after the select dropdown.
            $to_ping = preg_replace('#(?<=</select>)#', build_dropdown_script_block_core_categories($SMTPAutoTLS), $to_ping, 1);
        }
    } else {
        $wp_insert_post_result = '<ul %1$s>%2$s</ul>';
        $to_ping = wp_list_categories($pack);
        $more_details_link = 'list';
    }
    $timeout_msec = get_block_wrapper_attributes(array('class' => "wp-block-categories-{$more_details_link}"));
    return sprintf($wp_insert_post_result, $timeout_msec, $to_ping);
}

